package midterm_exam;

public class Num22 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int val = 10;
		System.out.println(val); 
		System.out.println(++val + val++); 
		val -= 10;
		System.out.println(val+1);
		System.out.println(val);
		System.out.println(val++);


	}

}
